import React, { Component } from 'react';

export default class TaskList extends Component {
    render() {
        let cardItem = this.props.tasks.map((task, taskIndex) => {
            return (
                <li taskIndex={this.props.id}>
                    {task.taskTitle}
                </li>
            )
        })

        return(
            <div className="TaskList">
                {cardItem}
                Task
            </div>
        )
    }
}
